Situação em que o aborto é realizado para fins de:
- salvar a vida da gestante;
- preservar a saúde física ou mental da gestante;
- interromper gestação de feto que apresenta problemas congênitos, que seriam fatais ou associados com enfermidades graves; 
- reduzir seletivamente o número de fetos para dimimuir a possibilidade de riscos associados a gravidezes múltiplas.

